/** @format */

import React, { Fragment, useEffect } from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import Container from "react-bootstrap/Container";
import FormControl from "react-bootstrap/FormControl";
import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";
import "../../components/rtl.css";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import { logout } from "../../actions/auth";

const NavbarF = ({ auth: { isAuthenticated, loading }, logout }) => {
  const authLinks = (
    <Fragment>
      <li>
        <a onClick={logout} href="/home">
          <Link className="nav-link NavIteamsStyle">logout</Link>{" "}
        </a>
      </li>

      <li>
        <a href="/register">
          <Link className="nav-link NavIteamsStyle">Add an Admin</Link>{" "}
        </a>
      </li>
    </Fragment>
  );
  const guestLinks = (
    <Fragment>
      <Link className="nav-link  NavIteamsStyle" to="/home">
        الصفحة الرئيسية
      </Link>
      <Link className="nav-link NavIteamsStyle" to="/Articles">
        مقالات
      </Link>
      <Link
        className="nav-link NavIteamsStyle"
        //   onClick={this.toggleMenu}
        to="/Researches"
      >
        أبحاث
      </Link>

      <Link className="nav-link NavIteamsStyle" to="/Videos">
        فيديوهات
      </Link>
      <Link className="nav-link NavIteamsStyle" to="/Books">
        كتب
      </Link>

      <Link className="nav-link NavIteamsStyle" to="/links">
        روابط
      </Link>
      <Link className="nav-link NavIteamsStyle" to="/Questions">
        أسئلة
      </Link>
      <Form inline className="mr-auto navform">
        <FormControl
          type="text"
          placeholder="بحث"
          className="mr-sm-2 NavIteamsStyle"
        />
        <Button variant="outline-success" className="NavIteamsStyle Navbutton ">
          ابحث
        </Button>
      </Form>
    </Fragment>
  );

  {
  }

  return (
    <Navbar bg="light" expand="lg ml-auto">
      <Navbar.Brand href="/home" className="NavIteamsStyle">
        علم النفس الإسلامي
      </Navbar.Brand>

      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          {!loading && (
            <Fragment>{isAuthenticated ? authLinks : guestLinks}</Fragment>
          )}
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
};

NavbarF.protoTypes = {
  logout: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired,
};

const mapStateToProps = (state) => ({
  auth: state.auth,
});
export default connect(mapStateToProps, { logout })(NavbarF);
